import React from "react";
import { Link } from "react-router-dom";

export default function HomePage({ cards, loading, error }) {
  return (
    <div style={{ 
      maxWidth: "1200px", 
      margin: "20px auto", 
      padding: "20px"
    }}>
      <div style={{ 
        textAlign: "center", 
        marginBottom: "40px",
        padding: "20px",
        backgroundColor: "#f8f9fa",
        borderRadius: "8px"
      }}>
        <h1>Bienvenido a WhaleCorp</h1>
        <p style={{ fontSize: "18px", maxWidth: "600px", margin: "0 auto" }}>
          Explora nuestra colecci贸n de personajes hist贸ricos marinos
        </p>
      </div>

      {loading ? (
        <div style={{ textAlign: "center", margin: "50px 0" }}>
          <div className="spinner"></div>
          <p>Cargando personajes...</p>
        </div>
      ) : error ? (
        <div style={{ textAlign: "center", margin: "50px 0", color: "#dc3545" }}>
          <p>Error al cargar los datos: {error}</p>
          <button 
            onClick={() => window.location.reload()}
            style={{
              padding: "10px 20px",
              background: "#007bff",
              color: "white",
              border: "none",
              borderRadius: "4px",
              cursor: "pointer"
            }}
          >
            Reintentar
          </button>
        </div>
      ) : cards.length === 0 ? (
        <div style={{ textAlign: "center", margin: "50px 0" }}>
          <p style={{ fontSize: "18px", color: "#6c757d" }}>No hay tarjetas disponibles</p>
          <Link 
            to="/login" 
            style={{
              display: "inline-block",
              marginTop: "20px",
              padding: "10px 20px",
              background: "#007bff",
              color: "white",
              textDecoration: "none",
              borderRadius: "4px"
            }}
          >
            Inicia sesi贸n como administrador
          </Link>
        </div>
      ) : (
        <div>
          <h2 style={{ textAlign: "center", marginBottom: "30px" }}>Personajes Destacados</h2>
          <div style={{ 
            display: "grid", 
            gridTemplateColumns: "repeat(auto-fill, minmax(300px, 1fr))", 
            gap: "30px"
          }}>
            {cards.map((card, index) => (
              <div 
                key={index} 
                style={{
                  border: "1px solid #dee2e6",
                  borderRadius: "8px",
                  overflow: "hidden",
                  boxShadow: "0 4px 6px rgba(0,0,0,0.05)",
                  transition: "transform 0.3s ease",
                }}
              >
                <div style={{ padding: "20px", backgroundColor: "#f8f9fa" }}>
                  <h3 style={{ marginTop: 0, color: "#007bff" }}>{card.title}</h3>
                </div>
                
                <div style={{ padding: "20px" }}>
                  {card.character ? (
                    <>
                      <h4 style={{ marginTop: 0 }}>{card.character.name}</h4>
                      <div style={{ 
                        display: "inline-block",
                        background: "#e9ecef",
                        padding: "3px 10px",
                        borderRadius: "20px",
                        marginBottom: "15px",
                        fontSize: "14px"
                      }}>
                        {card.character.label}
                      </div>
                      
                      <div style={{ display: "flex", gap: "15px", margin: "15px 0" }}>
                        <div>
                          <div style={{ fontSize: "12px", color: "#6c757d" }}>FECHA</div>
                          <div>{card.date}</div>
                        </div>
                        <div>
                          <div style={{ fontSize: "12px", color: "#6c757d" }}>HORA</div>
                          <div>{card.time}</div>
                        </div>
                      </div>
                    </>
                  ) : (
                    <p style={{ color: "#6c757d", textAlign: "center", padding: "20px 0" }}>
                      Tarjeta pendiente de asignaci贸n
                    </p>
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}
